pragma solidity 0.5.11;

contract KeyRing{

    KeyRing keyRing;
    address ringOwnerId;
    //for simplicity: one address maps to one public key
    struct KeyRing{
        address ringOwnerId;
        bool isSet;
        mapping (uint => mapping(uint => PublicKey)) publicKeys;
    }

    struct PublicKey{
        address keyOwnerId;
        Signature[] signatures;
    }

    struct Signature{
        address signerId;
        uint signature;
    }

    function createKeyRing(uint x, uint y, uint signature) public{
        require(keyRing.isSet == false, 'keyRing existing');
        keyRing.ringOwnerId = msg.sender;
        keyRing.publicKeys[x][y].keyOwnerId = msg.sender;
        keyRing.publicKeys[x][y].signatures.push(Signature(msg.sender, signature));
        keyRing.isSet = true;
    }

    function addPublicKey(uint x, uint y, address subject, uint signature, uint expiry) public {
        require(msg.sender == keyRing.ringOwnerId, 'only the ring owner can add keys');
        require(keyRing.publicKeys[x][y].keyOwnerId == address(0), 'key existing');
        keyRing.publicKeys[x][y].keyOwnerId = subject;
        keyRing.publicKeys[x][y].signatures.push(Signature(subject, signature));
    }

    function addSignature(uint x, uint y, uint signature) public{
        keyRing.publicKeys[x][y].signatures.push(Signature(msg.sender, signature));
    }
}
